function Navigation()
{

    function filterItem(category)
    {
       const  updataedList=  wonders.filter((item)=>{

        return item.category === category;

        })
         setData(updataedList);
    }
    
    return(
        <>
         <nav class="navbar navbar-expand-lg navbar-light bg-light">
                <a class="navbar-brand" href="#">GALLARY</a>
                <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria- 
                 expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
                <div class="collapse navbar-collapse" id="navbarNav">
                    <ul class="navbar-nav">
                        <li class="nav-item active" onClick={()=>setData(wonders)}>
                            <a class="nav-link" href="#">All<span class="sr-only">(current)</span></a>
                        </li>
                        <li class="nav-item" onClick={()=>filterItem("birds")}>
                            <a class="nav-link" href="#">Birds</a>
                        </li>
                        <li class="nav-item" onClick={()=>filterItem("flowers")}>
                            <a class="nav-link" href="#">Flowers</a>
                        </li>
                        <li class="nav-item" onClick={()=>filterItem("foods")}>
                            <a class="nav-link " href="#">Foods</a>
                        </li>

                        <li class="nav-item">
                            <a class="nav-link " href="#">Place</a>
                        </li>
                    </ul>
                </div>
            </nav>
        </>

    )
}

export default Navigation;
